"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Hirschsprung disease (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/hirschsprung-disease-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H15937733\">",
"      <span class=\"h1\">",
"       What is Hirschsprung disease?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Hirschsprung disease (also called &ldquo;HD&rdquo;) is a condition that stops or slows the movement of food and waste through the bowels (",
"      <a class=\"graphic graphic_figure graphicRef66110 \" href=\"UTD.htm?28/27/29107\">",
"       figure 1",
"      </a>",
"      ). Children who have HD cannot have normal bowel movements or have fewer bowel movements than normal. This causes the waste from their body to build up in the bowels. HD can cause a swollen belly, vomiting, and other symptoms. &nbsp;",
"     </p>",
"     <p>",
"      In a healthy person, the muscles that surround the bowels squeeze and relax. This pushes food and waste through the bowels and eventually leads to a bowel movement. In people with HD, part of the bowel does not work the way it should. It cannot relax to let things move along. This causes food and waste to get stuck.",
"     </p>",
"     <p>",
"      People who have HD were born with it. Doctors usually find it soon after a baby is born. Sometimes doctors do not find it until the child is older. This can happen when HD causes only mild symptoms. A few people do not find out they have HD until they are adults. People with Down syndrome are more likely to have HD than other people.",
"     </p>",
"     <p>",
"      HD can cause inflammation in the bowel that can be very serious. It can even cause death if it is not treated.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H15937748\">",
"      <span class=\"h1\">",
"       What are the symptoms of Hirschsprung disease?",
"      </span>",
"      &nbsp;&mdash;&nbsp;In newborn babies, symptoms of HD can include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Vomiting",
"       </li>",
"       <li>",
"        Belly swelling",
"       </li>",
"       <li>",
"        Not being able to have a bowel movement &mdash; By the time they are 2 days old, most babies have at least 1 bowel movement. If a baby does not have a bowel movement by then, he or she might have HD.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Some people with HD have mild symptoms. These can include: &nbsp;",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Constipation (trouble having a bowel movement, painful bowel movements, or very few bowel movements) &mdash; Constipation that is caused by HD might happen often and last a long time.",
"       </li>",
"       <li>",
"        Belly swelling",
"       </li>",
"       <li>",
"        Gaining less weight or growing less than normal, if still a baby or child &nbsp;",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      HD can cause bowel inflammation. This can be life threatening. It can happen before the doctor finds out a baby has HD. It can also happen after the baby has surgery to fix the HD.",
"     </p>",
"     <p>",
"      Symptoms of bowel inflammation can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Fever",
"       </li>",
"       <li>",
"        Vomiting",
"       </li>",
"       <li>",
"        Diarrhea that is very smelly &mdash; The diarrhea might have blood in it. &nbsp;",
"       </li>",
"       <li>",
"        Belly pain, swelling, or both",
"       </li>",
"       <li>",
"        Having low energy, or less interest in things than usual",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H15937763\">",
"      <span class=\"h1\">",
"       Should I see a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;See a doctor or nurse right away if you or your child has symptoms of bowel inflammation.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H15937778\">",
"      <span class=\"h1\">",
"       Are there tests for Hirschsprung disease?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. There are several tests doctors can do, but they might not all be needed. The doctor will do an exam and then decide if tests are needed.",
"     </p>",
"     <p>",
"      Tests for HD can include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Rectal biopsy &mdash; In this test, a doctor takes a small sample of tissue from inside the rectum (the part of the bowel right inside the body). Another doctor looks at it under a microscope to check for HD.",
"       </li>",
"       <li>",
"        Belly X-ray",
"       </li>",
"       <li>",
"        <a class=\"drug drug_patient\" href=\"UTD.htm?18/37/19028?source=see_link\">",
"         Barium",
"        </a>",
"        enema &mdash; In this test, a doctor squirts a fluid that shows up on an X-ray into the rectum. Then, he or she does an X-ray to look for HD. &nbsp;",
"       </li>",
"       <li>",
"        Manometry &mdash;&nbsp;This test measures the pressure at different places inside the rectum. It can tell the doctor if the muscles and nerves that control bowel movements are working right.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H15937793\">",
"      <span class=\"h1\">",
"       How is Hirschsprung disease treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Doctors treat HD by doing surgery to take out the part of the bowel that is not working normally.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H15937808\">",
"      <span class=\"h1\">",
"       Can my child live a normal life after treatment?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Probably.",
"      <strong>",
"      </strong>",
"      Most children and adults who have HD surgery live normal lives, but they can have bowel problems. These can include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Not being able to control bowel movements",
"       </li>",
"       <li>",
"        Constipation",
"       </li>",
"       <li>",
"        Bowel inflammation &mdash; This can happen before or after HD surgery. This means it is important to watch for symptoms of bowel inflammation, and see a doctor or nurse if they happen.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H15937825\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?42/2/43041?source=see_link\">",
"       Patient information: Constipation in children (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?20/59/21426?source=see_link\">",
"       Patient information: Constipation in adults (The Basics)",
"      </a>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_patient\" href=\"UTD.htm?15/7/15477?source=see_link\">",
"       Patient information: Constipation in infants and children (Beyond the Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_patient\" href=\"UTD.htm?34/10/34977?source=see_link\">",
"       Patient information: Constipation in adults (Beyond the Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_patient\" href=\"UTD.htm?3/53/3926?source=see_link\">",
"       Patient information: Irritable bowel syndrome (Beyond the Basics)",
"      </a>",
"     </p>",
