"     Deputy Editor",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?20/18/20776/contributors\">",
"     Elizabeth TePas, MD, MS",
"    </a>",
"    <br/>",
