var title_f20_18_20779="Taxonomy of aging";
var content_f20_18_20779=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F60632&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F60632&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Taxonomy of aging",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Group",
"       </td>",
"       <td class=\"subtitle1\">",
"        Characteristics",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Primary",
"       </td>",
"       <td>",
"        No functional dependence; negligible comorbidity",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Intermediate",
"       </td>",
"       <td>",
"        Dependence in one or more IADLs; stable comorbidity",
"(eg, stable angina, chronic renal insufficiency, etc)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\" rowspan=\"4\">",
"        Secondary or frail",
"       </td>",
"       <td>",
"        One of the following criteria:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        (i) Dependence in one or more ADLS;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        (ii) Three or more comorbid conditions or one poorly",
"controlled comorbid condition;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        (iii) One or more geriatric syndromes",
"(delirium, dementia, depression, falls, incontinence, spontaneous bone",
"fractures, neglect or abuse, failure to thrive)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Near death",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     ADLs: activities of daily living; IADLs: instrumental activities of daily living.",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Balducci L. Geriatric oncology. Crit Rev Oncol Hematol 2003; 46:212. Copyright &copy; 2003 Elsevier.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
